import React from "react";

import "./About.css";

const About = () => {
  return (
    <div className="about-container">
      <h1 className="text-center">
         Fall 2022 Group Project -- CSCI 4300
      </h1>
      <hr/>
      <h2 className="text-center">
        React, Axios, MongoDB
      </h2>
      <hr/>
      <div c>
        <h3>
          Group members:
        </h3>
        <ul>
          <li>John Lavender</li>
          <li>Jackson Henley</li>
          <li>Jacob Kossler</li>
        </ul>
      </div>
      <hr/>
      <a href="https://github.com/jaksonhensley/CSCI4300-FinalProject">Github repo</a>
    </div>
  );
};

export default About;
